import React from 'react';
import propTypes from 'prop-types';


AtomButton.propTypes = {
   ariaLabels : propTypes.string,
   className : propTypes.string,
   compact : propTypes.bool,
   disabled : propTypes.bool,
   icon : propTypes.bool,
   typeBtn : propTypes.any,
   variant : propTypes.oneOf(['primary', 'secondary', 'light','dark'])

};
AtomButton.defaultProps = {
   ariaLabels : null,
   className : null,
   compact : false,
   disabled : false,
   icon : false,
   typeBtn : 'button' ,
   variant : 'primary'
};
function AtomButton(props) {
    const variant = [];
    if (props.variant === 'primary') {
        variant.push('btn btn-primary');
    }
    if (props.variant === 'secondary') {
        variant.push('btn btn-secondary');
    }
    if (props.variant === 'light') {
        variant.push('btn btn-light');
    }
    if (props.variant === 'dark') {
        variant.push('btn btn-dark');
    }
    function renderButton (){
    return (
        <button 
           
            className = {props.className}
            compact = {props.compact}
            disabled = {props.disabled}
            icon = {props.icon}
            typeBtn = {props.typeBtn}
            variant = {props.variant}
        >
        {props.ariaLabels}
        </button>

    );
    }
    return renderButton ();
    
};

export default AtomButton;
